// ═══════════════════════════════════════════════════════════════

if (typeof module !== 'undefined' && module.exports) {
    module.exports = {
        STOPS,
        LINES,
        OPERATORS,
        CONFIG,
        ROUTE_GEOMETRIES,
        getStop,
        getStopName,
        getLine,
        getLineStops,
        getStopPositionInLine,
        getLinesForStop,
        getLineIdsForStop,
        searchStops,
        findStopIdByName,
        getAllStops,
        getAllLines,
        getTrolleybusLines,
        getBusLines,
        validateData,
        calculateEstimatedArrival,
        createStopsGeoJSON,
        createRoutesGeoJSON
    };
}

// For browser global access
if (typeof window !== 'undefined') {
    window.TRANSIT_DATA = {
        STOPS,
        LINES,
        OPERATORS,
        CONFIG,
        ROUTE_GEOMETRIES,
        // Expose helper functions
        getStop,
        getStopName,
        getLine,
        getLineStops,
        getStopPositionInLine,
        getLinesForStop,
        getLineIdsForStop,
        searchStops,
        findStopIdByName,
        getAllStops,
        getAllLines,
        getTrolleybusLines,
        getBusLines,
        validateData,
        calculateEstimatedArrival,
        createStopsGeoJSON,
        createRoutesGeoJSON,
        // Compatibility aliases
        center: CONFIG.center,
        defaultZoom: CONFIG.defaultZoom,
        trolleybusLines: getTrolleybusLines(),
        busLines: getBusLines()
    };
}
